import React from 'react'
import "./order-accepted.css"
const OrderAccepted = () => {
  return (
    <div className='order-accepted'>
        <div className='order-accepted-circle'>
        <svg xmlns="http://www.w3.org/2000/svg" width="100" height="100" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="3" stroke-linecap="round" stroke-linejoin="round" class="lucide lucide-check-icon lucide-check"><path d="M20 6 9 17l-5-5"/></svg>
        </div>
    </div>
  )
}

export default OrderAccepted
